export default function JFooter() {
    return (
        <div className="fixed-bottom">  
            <Navbar color="dark" dark expand="sm">
                <NavbarBrand>
                    <span className="author-name">Thomas L.</span>
                </NavbarBrand>
                <NavbarText>
                    <span className="about-github">Projet Dic o mots{t('Footer.2')}</span>
                </NavbarText>

            </Navbar>
        </div>
    )
}
